import React from 'react';
import Section from "react-bulma-components/lib/components/section";
import Box from 'react-bulma-components/lib/components/box';
import Media from 'react-bulma-components/lib/components/media';
import Image from 'react-bulma-components/lib/components/image';
import Content from 'react-bulma-components/lib/components/content';
import '../App.css';
import { useQuery } from "react-query";
import { getBuild} from "../middlewares/services";

const MascaraBuild = () => {
  const { isLoading, error, data } = useQuery("build", getBuild);
  if (isLoading) return "Loading...";
  if (error) return "Oops! ";
  return (
    <Section>
      <Box
        paddingless={boolean('paddingless', false)}
        responsive={{
          mobile: {
            display: {
              value: 'block'
            },
          },
          tablet: {
            display: {
              value: 'flex'
            },
          },
          desktop: {
            display: {
              value: 'inline-flex',
              only: true,
            },
          },
          widescreen: {
            display: {
              value: 'inline-block',
            },
          },
        }}
        hide={{
          tablet: {
            hide: true,
            only: true,
          },
          widescreen: {
            hide: true,
          },
        }}
      >
      { data.map( element =>
      <div>
        {element.bottle ?
          <div>
            <li key = { element.bottle.name }>{ element.bottle.name }</li>
            <li key = { element.bottle.thread }>{ element.bottle.thread } </li>
          </div>
          : "" }
        {element.brush ?
          <div>
            <li key = { element.brush.brush }>{ element.brush.brush }</li>
            <li key = { element.brush.type }>{ element.brush.type }</li>
          </div>
          : "" }
        {element.rod ?
          <div>
            <li key = { element.rod.name }>{ element.rod.name }</li>
            <li key = { element.rod.thread }>{ element.rod.thread }</li>
          </div>
          : "" }
        {element.wiper ?
          <div>
            <li key = { element.wiper.name }>{ element.wiper.name }</li>
            <li key = { element.wiper.drawing }>{ element.wiper.drawing }</li>
          </div>
          : "" }
      </div>
      )}
        <Media>
          <Media.Item renderAs="figure" position="left">
            <Image size={64} alt="64x64" src="http://bulma.io/images/placeholders/128x128.png" />
          </Media.Item>
          <Media.Item>
            <Content>
              <p>
                <strong>John Smith</strong> <small>@johnsmith</small> <small>31m</small>
                <br />
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Proin ornare magna eros, eu pellentesque tortor vestibulum ut. Maecenas non massa sem. Etiam finibus odio quis feugiat facilisis.
              </p>
            </Content>
          </Media.Item>
        </Media>
      </Box>

    </Section>
  )
};

export default MascaraBuild;
